commit_list.message:
Resolve external dependencies relative to package base.

For example, if we have `loadstar.require(‘lodash’);`

Then, in package.json, we can have:

```
“loadstar”: {
  “dependencies”: { 
    “lodash”: “./dist/lodash.min.js”
  }
}
```

Which will resolve to node_modules/lodash/dist/lodash.min.js

An absolute path will be rooted at our project root:

```
“loadstar”: {
  “dependencies”: { 
    “lodash”: “/vendor/lodash-mine.js”
  }
}
```

If you put false as the value inside the dependencies
object, then no warning will be output. Use this
if you are building a library that has external dependencies,
and allow the user of your library to add the dependency.

Add `bldr.installExpress`:

This will install a handler on an express app, which
adds a route to serve up all sources in dev mode, as
well as overriding the js app file to serve up the
contents of the dev shim.

```
if (process.env.NODE_ENV !== 'production') {
  bldr.installExpress(server, {rootDir: __dirname, app: '/js/app.min.js'});
}
```

bldr.setTransform — add a transform filter function

```
var reactTools = require('react-tools');
bldr.setTransform('jsx', function(src, options) {
  return reactTools.transform(src, {});
});
```

Allow specifying `appDir` and `global` from package.json

```
{
  “bldr”: {
     “appDir”: “lib/app”,
     “global”: “myapp”
  }
}
```

Add support for '{no}', or {notemplate} tags.

Will skip parsing anything within the {no} tag:

<script>{no}
var x = {};
{/no}</script>

Add ability to set unload routes:

r = new Router();
r.page('show', routeFn).unload(function(ctx,done) {
  console.log("called when we are navigating away from this page");
  done();
});

highbrow.extend can extend a passed in object

```
highbrow.extend('Model', 'User', {});
highbrow.extend(myapp.Model, 'User', {});
```

Add fetchAndContinue to Model/Collection:

Allows simplified code in router functions:

load = function(ctx,next) {
  ctx.posts = new Posts();
  ctx.posts.fetchAndContinue(next);
}
